import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import "./EjercicioUno.css";

const data = [
    {id : 1, personaje : "Naruto" , anime : "Naruto", imagen : "data:image/jpeg;base64,"},
    {id : 2, personaje : "Saitama" , anime : "One puch", imagen : "data:image/jpeg;base64,"},
    {id : 3, personaje : "Kirito" , anime : "Sword art online", imagen : "data:image/jpeg;base64,"},
    {id : 4, personaje : "Melon" , anime : "Akikan", imagen : "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQDc9gsljjg0sS-iVUB6S4YnOdfvXR4SREp3A&usqp=CAU"},
    {id : 5, personaje : "Zacian" , anime : "Pok√©mon", imagen : "data:image/jpeg;base64,"},
    {id : 6, personaje : "Koko" , anime : "Golden time", imagen : "data:image/jpeg;base64,"}
];

export default class EjercicioUno extends Component {
    
    id = React.createRef();
    name = React.createRef();
    anime = React.createRef();
    image = React.createRef();
    btnEliminar = React.createRef();
    btnModificar = React.createRef();

    state = {
        data : data
    };

    insertarPersonaje = (e) => {
        e.preventDefault();
        var idPj = this.id.current.value;
        var namePj = this.name.current.value;
        var animePj = this.anime.current.value;
        var imgPj = this.image.current.value;

        console.log(idPj);
        console.log(namePj);
        console.log(animePj);
        console.log(imgPj);

        var datosAnime = {
            id : idPj,
            personaje : namePj,
            anime : animePj, 
            imagen : imgPj
        }

        this.state.data.push(datosAnime);

        this.setState({
            data : this.state.data
        });

    };

    eliminarPersonaje = () => {
        var posicion = this.btnEliminar.current.value;
        console.log(posicion);
    };
    
    render() {
        return (
            <div>
                <div className="App">
                    <form onSubmit={this.insertarPersonaje}>
                        <h1>Datos Formulario</h1>
                        <br/>
                        <label>Id</label>{"  "}
                        <input type="text" readOnly value={this.state.data.length+1} ref={this.id}/> <br/>
                        <label>Nombre</label>{" "}
                        <input type="text" ref={this.name}/> <br/>
                        <label>Anime</label>{" "}
                        <input type="text" ref={this.anime}/> <br/>
                        <label>Imagen</label>{" "}
                        <input type="text" ref={this.image}/> <br/>
                        <br/><button onClick={this.insertarPersonaje}>Insertar Nuevo personaje</button><br/><br/>
                    </form>
                </div> <br/><br/>

                <h1 className="App">Datos Tabla</h1><br/><br/>

                <table className="table" border="2">
                    <thead>
                        <tr>
                            <th>Id</th>
                            <th>Personaje</th>
                            <th>Anime</th>
                            <th>Imagen</th>
                            <th>Accion</th>

                        </tr>
                    </thead>
                    <tbody>
                        {this.state.data.map((elemento, index)=>{
                            console.log(this.state.data.length);

                            return(
                            <tr key={index}>
                                <td>{elemento.id}</td>
                                <td>{elemento.personaje}</td>
                                <td>{elemento.anime}</td>
                                <td><img src={elemento.imagen}></img></td>
                                <td>
                                    <button value={index} ref={this.btnModificar}>Modificar</button>{" "}
                                    <button value={index} ref={this.btnEliminar} onClick={this.eliminarPersonaje}>Eliminar</button>
                                </td>
                            </tr>);
                        })}
                    </tbody>
                </table>
            </div>
        )
    }
}
